import {NavLink } from "react-router-dom";

export default function AppRouter() {
  return (
    <div className="header">
        <nav className="menu_header">
            <ul className="listado_header">
                <li className="listado"><NavLink to="/" className="navlink">Home</NavLink></li>
                <li className="listado"><NavLink to="/bio" className="navlink">Biography</NavLink></li>
                <li className="listado"><NavLink to="/knowledge" className="navlink">Knowledge</NavLink></li>
                <li className="listado"><NavLink to="/projects" className="navlink">Projects</NavLink></li>
                <li className="listado"><NavLink to="/contact" className="navlink">Contact</NavLink></li>
            </ul>
        </nav>
    </div>
    
  )
}
